     , (@parent_id, 1, 10 /* Tell */, 0, 1, NULL, 'Bringing their entire operation to a halt is far too ambitious at this stage, the Rynthid are extremely powerful creatures.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
