     , (@parent_id, 4, 10 /* Tell */, 0, 1, NULL, 'Several of our kind have infiltrated their ranks and discovered the location of their three largest stockpiles of ore. Take these vials, enter their Foundry and pour the Tainted Oil once onto each of the three Aetherium caches.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
     , (@parent_id, 5, 10 /* Tell */, 0, 1, NULL, 'This is sure to slow their production and help save many Gear Knights from being further corrupted by the Rynthid.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL)
